import React, {Component} from 'react';

const ReviewsList = () => {
    const {reviews} = this.props;
    const reviewList = reviews.map(review => {
        return (
            <div>
                <div>Name: {review.name}</div>
                <div></div>
            </div>
        );
    })
    return (
        <div>
            { reviewList }
        </div>
    );

}

export default ReviewsList;
